<!DOCTYPE html>

<body>

    <div id="app"></div>
    <div id="map"></div>

    <script>
      var map = null;
      function initMap() {
        map=new google.maps.Map(
            document.getElementById('map'), {
              center: {lat: -34.397, lng: 150.644},
              zoom: 8
            });
      }
    </script>
    <script src="https://maps.googleapis.com/maps/api/js?key=AIzaSyCy3bs_PTTKyG7xv6cWgqbs7seVWtds8kM&callback=initMap"></script>
